// NavBar.js
import React, { useEffect, useState } from "react";
import CartWidget from "../CartWidget/CartWidget";
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Offcanvas from 'react-bootstrap/Offcanvas';
import { NavLink } from "react-router-dom";
import { useNavigate } from "react-router-dom";
import { auth } from "../service/firebaseConfig";
import logo from '../../logo.png';
import '../../index.css';
import { Link } from 'react-router-dom';


const NavBar = () => {
  const [user, setUser] = useState(null);
  const navigate = useNavigate();

 
  useEffect(() => {
    const unsubscribe = auth.onAuthStateChanged((currentUser) => {
      setUser(currentUser);
    });
    return () => unsubscribe();
  }, []);

  const handleLogout = async () => {
    await auth.signOut();
    localStorage.removeItem("firebaseToken");
    setUser(null);
    navigate("/"); 
  };

  return (
    <>
      {['xxl'].map((expand) => (
        <Navbar key={expand} sticky="top" bg="light" expand={expand} className="mb-3">
          <Container fluid>
            <NavLink to="/" className="navbar-brand text-opacity-20 text-primary bg-opacity-100">
              <span className="fw-bolder">Equipo 1 - ECommerce</span>
              <img src={logo} alt="Logo" width="80" height="80" className="shadow-none opacity-100 mx-3" />
            </NavLink>
            
            <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-${expand}`} />
            
            <Navbar.Offcanvas
              id={`offcanvasNavbar-expand-${expand}`}
              aria-labelledby={`offcanvasNavbarLabel-expand-${expand}`}
              placement="end"
            >
              <Offcanvas.Header closeButton>
                <Offcanvas.Title id={`offcanvasNavbarLabel-expand-${expand}`}>
                  Equipo 1 E-Commerce
                </Offcanvas.Title>
              </Offcanvas.Header>
              
              <Offcanvas.Body>
                <Nav className="justify-content-end flex-grow-1 pe-3">
                  <NavLink className="inactive nav-link" to="/">Home</NavLink>
                  
                  <NavDropdown title="Tienda" className="drop" id={`offcanvasNavbarDropdown-expand-${expand}`}>
                    <NavLink className="inactive dropdown-item" to="/category/notebook">Notebooks</NavLink>
                    <NavLink className="inactive dropdown-item" to="/category/celular">Celulares</NavLink>
                    <NavLink className="inactive dropdown-item" to="/category/tablet">Tablets</NavLink>
                  </NavDropdown>

                    {userRole === 'admin' && (
                      <>
                      <Link to="/clientes">Clientes</Link>
                      <Link to="/suppliers">Proveedores</Link>
                      <Link to="/products">Productos</Link>
                      <Link to="/sales-report">Reportes de Ventas</Link>
                      <Link to="/purchase-report">Reportes de Compras</Link>
          
                      
                      <NavLink className="inactive nav-link" to="/clientes">Clientes</NavLink>
                      <NavLink className="inactive nav-link" to="/suppliers">Proveedores</NavLink>
                      <NavLink className="inactive nav-link" to="/products">Productos</NavLink>
                      
                      <NavDropdown title="Reportes" className="drop" id={`offcanvasNavbarDropdown-expand-${expand}`}>
                        <NavLink className="inactive dropdown-item" to="/sales-report">Ventas</NavLink>
                        <NavLink className="inactive dropdown-item" to="/purchase-report">Compras</NavLink>
                      </NavDropdown>
                   </>
                   )}
                  <NavLink className="inactive nav-link" to="/contact">Contacto</NavLink>

                  {/* Login/Logout Button */}
                  {user ? (
                    <button onClick={handleLogout} className="btn btn-outline-primary mx-2">Cerrar sesión</button>
                  ) : (
                    <NavLink className="btn btn-primary" to="/auth/login">Iniciar sesión</NavLink>
                  )}
                </Nav>
                
                <CartWidget className="rounded-5" />
              </Offcanvas.Body>
            </Navbar.Offcanvas>
          </Container>
        </Navbar>
      ))}
    </>
  );
}

export default NavBar;
